package com.cleanmvvm.starwars.data.dtoimport com.cleanmvvm.starwars.data.base.BaseDTOTestimport org.junit.Assertclass CharacterSearchDTOTest : BaseDTOTest<CharacterSearchDTO>(CharacterSearchDTO::class.java) {    override var serverJson: String = """     {        "count": 5,         "results": [           {            "name": "Luke Skywalker",             "height": "172",             "url": "http://swapi.dev/api/people/1/"            }         ]     }    """.trimIndent()    override fun assertClassUnderTestValues(classUnderTest: CharacterSearchDTO) {        Assert.assertEquals("count should match", 5, classUnderTest.count)        Assert.assertEquals("results should match", listOf("Luke Skywalker", 172, "http://swapi.dev/api/people/1/"), classUnderTest.results)    }}